How can apply a group by to a result of another group by using MongoDb?<p>Let's suppose I have the following POCO's representing documents in Mongo:</p>

<pre><code>public class A
{
    [BsonId, BsonRepresentation(BsonType.ObjectId)]
    public string Id { get; set; }
    public string Name { get; set; }
    public string LastName { get; set; }
    public bool Locked { get; set; }
}
public class B
{
    [BsonId, BsonRepresentation(BsonType.ObjectId)]
    public string Id { get; set; }
    public string Name { get; set; }
}
public class C
{
    [BsonId, BsonRepresentation(BsonType.ObjectId)]
    public string Id { get; set; }
    public string Name { get; set; }
}
public class AB
{
    [BsonId, BsonRepresentation(BsonType.ObjectId)]
    public string Id { get; set; }
    [BsonRepresentation(BsonType.ObjectId)]
    public string AId { get; set; }
    [BsonRepresentation(BsonType.ObjectId)]
    public string BId { get; set; }
}
public class AC
{
    [BsonId, BsonRepresentation(BsonType.ObjectId)]
    public string Id { get; set; }
    [BsonRepresentation(BsonType.ObjectId)]
    public string AId { get; set; }
    [BsonRepresentation(BsonType.ObjectId)]
    public string CId { get; set; }
}
</code></pre>

<p>The relationships are <code>A many-to-many B</code> and <code>A many-to-many C</code>. My goal is to query all <code>A</code> documents that aren't locked and include all <code>B</code>'s and <code>C</code>'s related to the <code>A</code> document. For that I've tried a lot of attempts but I'll post the most (I think) completed one: </p>

<pre><code>var q = from a in A_Col.AsQueryable()
     where !a.Locked
     join ab in AB_Col.AsQueryable() on a.Id equals ab.AId
     join b in B_Col.AsQueryable() on ab.BId equals b.Id into Bs
     group new { a.Id, a.Name, a.LastName, Bs = Bs.DefaultIfEmpty() }
     by new { a.Id, a.Name, a.LastName } into ABs
     from abs in ABs.DefaultIfEmpty()
     join ac in AC_Col.AsQueryable() on abs.Id equals ac.AId
     join c in C_Col.AsQueryable() on ac.CId equals c.Id into Cs
     group new { abs.Id, abs.Name, abs.LastName, abs.Bs, Cs = Cs.DefaultIfEmpty() }
     by new { abs.Id, abs.Name, abs.LastName };
</code></pre>

<p>When I try to execute the query I get the following error:</p>

<blockquote>
  <p>The method GroupBy is not supported in the expression tree: aggregate([]).Where(a => Not(a.Locked)).Join(aggregate([]), a => a.Id, ab => ab.AId, (a, ab) => new &lt;>f__AnonymousType0<code>2(a = a, ab = ab)).GroupJoin(aggregate([]), &lt;&gt;h__TransparentIdentifier0 =&gt; &lt;&gt;h__TransparentIdentifier0.ab.BId, b =&gt; b.Id, (&lt;&gt;h__TransparentIdentifier0, Bs) =&gt; new &lt;&gt;f__AnonymousType1</code>2(&lt;>h__TransparentIdentifier0 = &lt;>h__TransparentIdentifier0, Bs = Bs)).GroupBy(&lt;>h__TransparentIdentifier1 => new &lt;>f__AnonymousType3<code>3(Id = &lt;&gt;h__TransparentIdentifier1.&lt;&gt;h__TransparentIdentifier0.a.Id, Name = &lt;&gt;h__TransparentIdentifier1.&lt;&gt;h__TransparentIdentifier0.a.Name, LastName = &lt;&gt;h__TransparentIdentifier1.&lt;&gt;h__TransparentIdentifier0.a.LastName), &lt;&gt;h__TransparentIdentifier1 =&gt; new &lt;&gt;f__AnonymousType2</code>4(Id = &lt;>h__TransparentIdentifier1.&lt;>h__TransparentIdentifier0.a.Id, Name = &lt;>h__TransparentIdentifier1.&lt;>h__TransparentIdentifier0.a.Name, LastName = &lt;>h__TransparentIdentifier1.&lt;>h__TransparentIdentifier0.a.LastName, Bs = &lt;>h__TransparentIdentifier1.Bs.DefaultIfEmpty()))</p>
</blockquote>

<p>I also noted that the resolved <code>GroupBy</code> is coming from <code>System.Linq</code> namespace (not 100% sure) and not from <code>MongoDB.Driver.Linq</code> namespace. 
After a while modifying here and there I tried to do so in the following way:</p>

<pre><code>var q = A_Col.AsQueryable().Where(a =&gt; !a.Locked)
    .Join(
       AB_Col.AsQueryable(),
       a =&gt; a.Id, 
       ab =&gt; ab.AId,
       (a, ab) =&gt; new
       {
          A = new { a.Id, a.Name, a.LastName },
          AB = new { ab.AId, ab.BId }
       })
    .Join(
       B_Col.AsQueryable(), 
       a_doc =&gt; a_doc.AB.BId,
       b =&gt; b.Id, 
       (a, b) =&gt; new { a.A.Id, a.A.Name, a.A.LastName, B = new { b.Name, b.Id } })
    .GroupBy(doc =&gt; new { doc.Id, doc.Name, doc.LastName })
    .Join(
        AC_Col.AsQueryable(),
        g =&gt; g.Key.Id,
        ac =&gt; ac.AId,
        (g, ac) =&gt; new
        {
           g.Key.Id,
           g.Key.Name,
           g.Key.LastName,
           Bs = g.Select(x =&gt; x.B),
           AC = new { ac.AId, ac.CId }
        })
    .Join(
        C_Col.AsQueryable(),
        gac =&gt; gac.AC.CId,
        c =&gt; c.Id,
        (gac, c) =&gt; new { gac.Id, gac.Name, gac.LastName, gac.Bs, C = new { c.Name, c.Id } })
    .GroupBy(doc =&gt; new { doc.Id, doc.Name, doc.LastName, doc.Bs })
    .Select(g =&gt; new { g.Key.Id, g.Key.Name, g.Key.LastName, g.Key.Bs, Cs = g.Select(x =&gt; x.C) });
</code></pre>

<p>And now the error is</p>

<blockquote>
  <p>$project or $group does not support {document}.</p>
</blockquote>

<p>I've seen this one before but in the above code I can't see why it's happening. Can you help me out? It's so frustrating I can't figure this out! </p>

<p>The next data inserted into a test DB:</p>

<pre><code>var mongoClient = new MongoClient("mongodb://localhost");
var database = mongoClient.GetDatabase("TestDb");

var a1 = new A { Name = "A1-&gt;Name", LastName = "A1-&gt;LastName", Locked = false };
